import React , {useState} from 'react'
import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import logo from "../images/Bullbear logo.png"
import "../styles/Searchbar.css"

function Searchbar() {

  function showTickerData(event){
        axios.get('http://127.0.0.1:8000/tickerdata/')
        .then((res)=>{
            console.log(res.data)
            this.setState({Ticker:res.data})
        })
  } showTickerData();

  function handleSignUpClick() {
    window.location.href = '/signup';
  }

  function handleLoginClick() {
    window.location.href = '/login';
  }

  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [showResults, setShowResults] = useState(false);

  const handleChange = (event) => {
    setSearchTerm(event.target.value);
    setShowResults(true);

    // Fetch data from API or perform search operation
    // Here, we are using a static array for demo purposes
    const data = ['Apple', 'Banana', 'Cherry', 'Grapes', 'Kiwi', 'Mango', 'Orange', 'Pineapple'];
    const results = data.filter(item => item.toLowerCase().includes(searchTerm.toLowerCase()));
    setSearchResults(results);
  };

  const handleSelect = (item) => {
    setSearchTerm(item);
    setShowResults(false);
  };


  return (
    <>
    <div class="navbar">
      <div class="navbar-left">
        <div class="navbar-logo">
          <img src={logo} alt="Company Logo"/>
        </div>
        <a href="/" class="navbar-title">Bulls and Bears</a>
      </div>
      <div class="navbar-right">
        <button class="navbar-button" onClick={handleSignUpClick}>Sign Up</button>
        <button class="navbar-button" onClick={handleLoginClick}>Sign In</button>
      </div>
    </div>
    <h1>Searchbar</h1>
    <div className="searchbar">
      <input
        type="text"
        placeholder="Search..."
        value={searchTerm}
        onChange={handleChange}
        className="searchbar-input"
      />
      {showResults && searchResults.length > 0 &&
        <ul className="searchbar-results">
          {searchResults.map((item, index) => (
            <li key={index} onClick={() => handleSelect(item)}>
              {item}
            </li>
          ))}
        </ul>
      }
    </div>
    </>
  )
}

export default Searchbar
